import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import { Navbarseaction, Logo, Logotext, UlList, ListItem, Achor } from './style.js';



const Navbar = () => {
	return (
		<Navbarseaction>
			<div className="container">
				<Logo>
					<Logotext>Ultra Profile</Logotext>
				</Logo>

				<UlList>
					<ListItem>
						<LinkCss to="/">Home</LinkCss>
					</ListItem>
					<ListItem>
						<Achor href="#">Work</Achor>
					</ListItem>
					<ListItem>
						<Achor href="#">Portfolio</Achor>
					</ListItem>
					<ListItem>
						<Achor href="#">Resume</Achor>
					</ListItem>
					<ListItem>
						<Achor href="#">About</Achor>
					</ListItem>
					<ListItem>
						<LinkCss to="/Contact">Contact</LinkCss>
					</ListItem>
				</UlList>
			</div>
		</Navbarseaction>
	);
};
export default Navbar;
